import React from 'react';

class App extends React.Component {
  constructor(props){
    super(props)

    this.state = {
      search: ''
    }
  }

  handleInput = (event) =>{
    console.log(event.target.value);
    this.setState({
      search: event.target.value
    })
  }

  render(){
    return (
      <div>
        <input type="text" onChange={this.handleInput}/>
        <button on>submit</button>
      </div>
    )
  }
}

export default App;
